import React from 'react'
import './Slider.css'
import Background from '../images/pexels-felipe.jpg'


function Slider() {
    return (
        <div className="lander">
            <img src="https://cdn.pixabay.com/photo/2016/02/16/19/54/jewellery-1203951_960_720.jpg" className="image">
                <span>Welcome to our e-shop,with the most reliable products and services</span>
            </img>

        </div>
    )
}

export default Slider
